  \"Economic feasibility, cost and issues related to acquiring water right options
  to secure drought water supplies for Lahontan Valley Wetlands\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 16,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:18:27.908120\",\n\t\"name\": \"economic-feasibility-cost-and-issues-related-to-acquiring-water-right-options-to-secure-dr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The focus of this study, prepared for The
  Nature Conservancy, is on the economic feasibility and issues related to implementing
  water supply option contracts to provide the Lahontan Valley Wetlands with supplemental
  or temporary water as needed, assuming proposed management strategies and conditions.
  \ Specifically, this report: 1) addresses economic, hydrologic and legal issues
  and information required to analyze and establish water right option contracts;
  2) develops estimates of the variables required to evaluate option contract feasibility;
  3) conducts an evaluation of the economic feasibility and financial requirements
  of option contracts under proposed conditions and water delivery strategies; 4)
  explores the economic benefits/costs of option contracts under alternative management
  and market condition scenarios; and 5) suggests possible modifications in existing
  water management proposals and institutions that could reduce program impacts and
  improve the cost-effectiveness of the overall water right acquisition program.\",\n\t\"license_title\":
